import React from 'react'

class DashTaskList extends React.Component {
  state = {
    loaded: false
  };
  componentDidMount() {
    setTimeout(()=>{
      this.setState({loaded: true});
    }, 50);
  }
  render() {
    return (
      <section id="dash-task-list">
        <h2>{"today's task list"}</h2>
        <ul>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
        </ul>
      </section>
    );
  }
}

export default DashTaskList
